function App() {
  return (
    <div className={styles.app}>
        <Si/>
        <div style={{display:"flex",flexDirection:"column",backgroundColor:"#E7EFFF"}}>
            <Navbar/>
            <AreaCard work="in training workers" number="3,354" rise="up"/>
        </div>
    </div>
  );
}

export default App;
